// Initialize primitive roots of unity vector
void create_zeta_array(uint64_t zetas_lower[2048], uint64_t zetas_higher[2048], uint128_t zetas[2048])
{
    for (int i = 0; i < NEWHOPE_N / 2; i++) 
    {
        zetas[i] = (uint128_t) zetas_lower[i] + (((uint128_t) zetas_higher[i]) << 64);
    }

    for (int i = 0; i < NEWHOPE_N / 2; i++)
    {
        uint64_t lower = (zetas[i] &((uint128_t) BLOCK_64));
        if (lower != zetas_lower[i])
        {
            printf("-------------------------------------------\n");
            printf("LOWER ERROR AT %d\n", i);
            break;
        }

        uint64_t higher = ((zetas[i] >> 64));
        if (higher != zetas_higher[i])
        {
            printf("-------------------------------------------\n");
            printf("HIGHER ERROR AT %d %ld != %ld\n", i, higher, zetas_higher[i]);
            break;
        }
    }
}

int sodium_compare(const uint128_t a, const uint128_t b)
{
    uint64_t gt = 0U;
    uint64_t eq = 1U;

    uint64_t a1 = (a >> 64);
    uint64_t b1 = (b >> 64);

    gt |= (((uint128_t) b1 - a1) >> 64) &eq;
    eq &= (((uint128_t) b1 ^ a1) - 1) >> 64;

    a1 = a;
    b1 = b;

    gt |= (((uint128_t) b1 - a1) >> 64) &eq;
    eq &= (((uint128_t) b1 ^ a1) - 1) >> 64;

    return (int)(gt + gt + eq);
}

uint128_t a_greater_b(const uint128_t a, const uint128_t b)
{
    uint128_t return_value[3] = { 0, 0, 1 };
    return return_value[sodium_compare(a, b)];
}

uint128_t a_less_b(const uint128_t a, const uint128_t b)
{
    uint128_t return_value[3] = { 1, 0, 0 };
    return return_value[sodium_compare(a, b)];
}

uint128_t addModP(uint128_t in1, uint128_t in2)
{
    uint128_t out = in1 + in2;

    out += (a_less_b(out + MODP, in1) | a_greater_b(out, -MODP)) *MODP;
    return out;
}

uint128_t subModP(uint128_t in1, uint128_t in2)
{
    uint128_t out = in1 - in2;

    out -= a_greater_b(in2, in1) *MODP;

    return out;
}

uint128_t mulitply_mod(uint128_t input_a, uint128_t input_b)
{
    uint128_t output = 0;

    uint128_t input_a_low = input_a &half_block;
    uint128_t input_a_high = input_a >> 64;

    uint128_t input_b_low = input_b &half_block;
    uint128_t input_b_high = input_b >> 64;

   	// lowlow
    output = input_a_low * input_b_low;

   	//lowhigh
    uint128_t lowhigh = addModP(input_a_low *input_b_high, input_a_high *input_b_low);

    uint128_t lowhigh_low = lowhigh &half_block;
    uint128_t lowhigh_high = lowhigh >> 64;

    output = addModP(output, lowhigh_high *MODP);
    output = addModP(output, (lowhigh_low << 64));

   	//lowhigh_high
    uint128_t highhigh = input_a_high * input_b_high;
    uint128_t highhigh_low = highhigh &half_block;
    uint128_t highhigh_high = highhigh >> 64;

   	//output += highhigh_low*MODP;
    output = addModP(output, (highhigh_low *MODP));

    uint128_t highhighhigh = MODP * highhigh_high;
    uint128_t highhighhigh_low = highhighhigh &half_block;
    uint128_t highhighhigh_high = highhighhigh >> 64;

    output = addModP(output, (highhighhigh_high *MODP));
    output = addModP(output, (highhighhigh_low << 64));

    return output;
}

int pad_array(int8_t *buf, int size)
{
    int pad_bytes = (int) PAD_SIZE;
    pad_bytes = (pad_bytes - (size % pad_bytes)) % pad_bytes;
    for (int i = 0; i < pad_bytes; i++)
    {
        buf[size + i] = pad_bytes;
    }

    return size + pad_bytes;
}

int unpad_array(int8_t *buf, int size)
{
    if (size == 0) return size;

    int last_value = buf[size - 1];
    int counter = 1;

    if (last_value > size || last_value >= PAD_SIZE || last_value < 0) 
        return size;

    for (int i = 2; i <= size; i++)
    {
        if (buf[size - i] == last_value) counter++;
        else break;
    }

    if (counter >= last_value) 
        return (size - last_value);

    return size;
}
